        static int GetCalibration(List<string> list, List<string> digitsStrings)
        {
            int sum = 0;
            foreach (var stringValue in list)
            {
                var digits = new Dictionary<int, int>();
                //checking strings first
                foreach (var digitsValueString in digitsStrings)
                {
                    int index = -1;

                    while ((index = stringValue.IndexOf(digitsValueString, index + 1)) != -1)
                    {
                        digits.Add(index, ParseStringToInt(digitsValueString));
                    }
                }

                //checking char values
                for (int i = 0; i < stringValue.Length; i++)
                {
                    if (char.IsDigit(stringValue[i]))
                    {
                        var intDigit = int.Parse(stringValue[i].ToString());
                        digits.Add(i, intDigit);
                    }
                }

                var digitsOrdered = digits.OrderBy(x => x.Key).ToDictionary(x => x.Key, x => x.Value);
                var toAddString = digitsOrdered.First().Value.ToString() + digitsOrdered.Last().Value.ToString();
                var toAddInt = int.Parse(toAddString);
                sum += toAddInt;
            }

            return sum;
        }

        static int ParseStringToInt(string s)
        {
            switch (s)
            {
                case "one": return 1;
                case "two": return 2;
                case "three": return 3;
                case "four": return 4;
                case "five": return 5;
                case "six": return 6;
                case "seven": return 7;
                case "eight": return 8;
                case "nine": return 9;
                default: return 0;
            }
        }

        static List<string> ParseString(string input)
        {
            List<string> parsedStrings = new List<string>();
            string[] lines = input.Split('\n');
            foreach (string line in lines)
            {
                parsedStrings.Add(line.Trim());
            }
            return parsedStrings;
        }
